import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <container className='navbar'>
          <Row>

            <col>
              <h1>
                CLICK THAT SHHHTUFF
              </h1>
            </col>

            <col>
              <h3>This is where the instructions go.  Once a game is started this will also dynamically render how many points the user currently has</h3>
            </col>

          </Row>         
        </container>
      </div>
    )
  }
}

export default App;
